import React from "react";
import Layout from "../Layout";

function Home() {
  return (
    <Layout>
      <div>
        <img 
        src="https://i.pinimg.com/564x/7a/8b/17/7a8b17d11848f172dfd9c1828af76b6c.jpg"
        width="100%"
        alt=""
        />
      </div>
    </Layout>
  );
}

export default Home;
